INSERT INTO `journal_encounter_section_locale` (`ID`, `locale`, `Title_lang`, `BodyText_lang`, `VerifiedBuild`) VALUES
(30861, 'frFR', 'DPS', '$bullet; Il faut attirer les boute-flammes à l\’écart du raid. L\’explosion de la |cFF2959D3|Hspell:464983|h[Torche]|h|r est considérable et inflige des dégâts importants.\n$bullet; Les marcheflammes lancent |cFF2959D3|Hspell:470164|h[Infusion de magma]|h|r jusqu\’à ce qu\’ils soient vaincus, ce qui complique les déplacements dans le Hall de fer.\n$bullet; Les personnages-joueurs doivent détruire les ancres de portail le plus vite possible tout en empêchant les esprits ardents de lancer |cFF2959D3|Hspell:464769|h[Fureur des terres de Feu]|h|r.', 57534),
(30900, 'frFR', 'Vue d\’ensemble', 'L\’empereur Dagran Thaurissan et la princesse Moira Barbe-de-Bronze sont aussi formidables l\’un que l\’autre. Il faut faire attention au |cFF2959D3|Hspell:466504|h[Mot de l\’ombre : Némésis]|h|r et au |cFF2959D3|Hspell:470599|h[Mot de l\’ombre : Nécrose]|h|r de Moira, sinon ils peuvent submerger le raid. Moira tente de soigner Dagran avec |cFF2959D3|Hspell:470605|h[Infusion radieuse]|h|r. \n\nDagran est un combattant en mêlée dangereux qui peut |cFF2959D3|Hspell:465077|h[Appeler la garde impériale]|h|r et |cFF2959D3|Hspell:465079|h[Appeler un ambassadeur ou une ambassadrice du Marteau du crépuscule]|h|r pour repousser l\’invasion. Une fois que Moira est vaincue, Dagran se transforme en un puissant |cFF2959D3|Hspell:465069|h[avatar des Flammes]|h|r, ce qui renforce toutes ses techniques.\n\nLorsqu\’il devient désespéré, Dagran se met à |cFF2959D3|Hspell:466332|h[Implorer le seigneur du Feu]|h|r de le sauver. L\’avatar de Ragnaros déchaîne une dévastation qui ravage toute la salle sous la lave en fusion jusqu\’à ce que Dagran soit vaincu. Dagran n\’appelle plus de garde impériale ou d\’unités ambassadrices du Marteau du crépuscule à son côté une fois que Ragnaros rejoint le combat.', 57534),
(31073, 'frFR', '', '', 57534),
