(30722, 'frFR', 'Vue d\’ensemble', 'Le seigneur Roccor lance |cFF2959D3|Hspell:462351|h[Magma écumant]|h|r sur sa cible, ce qui inflige des dégâts et fournit la matière première pour la |cFF2959D3|Hspell:463674|h[Cristallisation]|h|r de sa progéniture d\’obsidienne.\n\nLorsque le seigneur Roccor atteint 95 % de ses points de vie, et tous les 20 % de points de vie en moins ensuite, il lance |cFF2959D3|Hspell:462322|h[Éruption]|h|r, qui remplit la salle de |cFF2959D3|Hspell:462351|h[Magma écumant]|h|r. Chaque |cFF2959D3|Hspell:462346|h[magma vivant]|h|r qui atteint sa destination augmente la puissance de l\’élémentaire créé par la |cFF2959D3|Hspell:462320|h[Cristallisation ignée]|h|r.\n\nUne fois arrivé à 100 points d\’énergie, Roccor lance |cFF2959D3|Hspell:462317|h[Soulèvement volcanique]|h|r, qui inflige d\’énormes dégâts aux personnages-joueurs.', 57534),
(5499, 'frFR', 'Fissure d\'ombre inférieure', 'Le grand démoniste Néanathème ouvre une fissure de Consomption sous les pieds d\’un personnage-joueur. Ce dernier subit $30498s1 $lpoint:points; de dégâts d\’ombre toutes les $30498t1 s tant qu\’il reste dans le champ d\’action de la fissure.', 57534),
(30988, 'frFR', 'Section 27', '', 57534),
(30760, 'frFR', 'Section 5', '', 57534),
(4910, 'frFR', 'Salve', 'Illyanna Corvichêne tire une rafale de flèches sur tous les personnages-joueurs dans un rayon de $30933A1 m. La rafale inflige $448891s1 |4point:points; de dégâts des arcanes toutes les $448891t1 s pendant $30933d.', 57534);
