(2265, 'frFR', 'Brutosaure doré de négoce', '|cFFFFD200Boutique en jeu|r', 'Morten et Killia n\’avaient jamais réalisé à quel point leur nouveau partenariat commercial interfaction serait rentable. Du moins jusqu\’au jour où ils avaient pu acheter cette belle créature pour voyager et parader plus facilement.', 57534),
